import React from 'react'

const SearchCard = ({data}) => {

  if (!data || !data.snippet) {
    return <div>Error: Invalid data</div>;
  }


  console.log(data?.snippet);

const {title , description , channelTitle , thumbnails} = data.snippet

  // const {id , snippet} =data;
  

  // const {videoId} = id;
  // const {title , description , channelTitle , thumbnails} = snippet;

  // console.log(id , snippet)

  return (
    <div className='bg-white p-2  h-56 rounded-2xl flex'>
     
         <img className='w-1/3 h-[230px] rounded-xl ' alt='Thumbnail' src={thumbnails.medium.url}></img>
    
      <div className=' ml-4 w-2/3 rounded-xl flex flex-col space-'>
          <h1 className='text-2xl '>{title}</h1>
          <p>Channel: {channelTitle}</p>
          <p>{description}</p>


      </div>
    </div>
  )
}

export default SearchCard
